import React from 'react';
import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip, ResponsiveContainer } from 'recharts';

const SimpleGraph = () => {
  const data = [
    { name: 'Jan', scheduled: 10, completed: 5 },
    { name: 'Feb', scheduled: 20, completed: 15 },
    { name: 'Mar', scheduled: 30, completed: 25 },
  ];

  return (
    <ResponsiveContainer width="100%" height={300}>
      <LineChart data={data} margin={{ top: 20, right: 30, left: 0, bottom: 0 }}>
        <CartesianGrid stroke="#ccc" />
        <XAxis dataKey="name" />
        <YAxis />
        <Tooltip />
        <Line type="monotone" dataKey="scheduled" stroke="#ff8c00" />
        <Line type="monotone" dataKey="completed" stroke="#007bff" />
      </LineChart>
    </ResponsiveContainer>
  );
};

export default SimpleGraph;
